window.bookSummaryJSON = "<p>\"Daniel Henning is a great narrator for this quirky and theatrical audiobook.... Henning revels in a cornucopia of characters, diving into nuanced voices and colorful moments with accents and growls, tone shifts and whispers.... This is definitely a title for those who enjoy fantasy stories replete with gnomes and witches and all in between.\" (<i>AudioFile </i>Magazine) </p> <p><b>Lambda Literary Award-winning author TJ Klune's breakout contemporary fantasy </b></p> <p>Linus Baker is a by-the-book case worker in the Department in Charge of Magical Youth. He's tasked with determining whether six dangerous magical children are likely to bring about the end of the world. </p> <p>Arthur Parnassus is the master of the orphanage. He would do anything to keep the children safe, even if it means the world will burn. And his secrets will come to light.</p> <p><i>The House in the Cerulean Sea</i> is an enchanting love story, masterfully told, about the profound experience of discovering an unlikely family in an unexpected place - and realizing that family is yours. </p> <p><b><i>Chicago Tribune </i></b><b>Best Books of the Year - 2020 </b></p> <p><b>Amazon.com Best Books of the Year - 2020 </b></p> <p>A Macmillan Audio production from Tor Books</p> <p><b>\"</b><b><i>1984 </i></b><b>meets </b><b><i>The Umbrella Academy</i></b><b> with a pinch of Douglas Adams thrown in.\" (Gail Carriger, </b><b><i>New York Times</i></b><b> best-selling author of </b><b><i>Soulless</i></b><b>)</b></p>"; 
